import styled from "styled-components";

export const Zhucestyle =styled.div`


.delu_go {
    height: .45rem;
    text-align: center;
    line-height: .45rem;
    position: relative;
    font-size: .16rem;
}

.fanhui {
    position: absolute;
    top: .04rem;
    left: .2rem;
    font-size: .16rem;
}

.mima_input,.yzm_input,
.ipone_input {
    height: .46rem;
    padding: .1rem 0;
    margin: 0 .28rem;
    display: flex;
    justify-content: flex-start;
    align-items: center;
    overflow: hidden;
    border-bottom: 1px solid #ccc;
}

.mima_input input,.yzm_input input,
.ipone_input input {
    margin-left: .07rem;
    width: 2.7rem;
    height: .36rem;
    border: none;
}

.butten {
    margin: 0 .28rem;
    padding: .21rem 0 .14rem;
    overflow: hidden;
    height: .72rem;
}

.butten>input {
    width: 100%;
    height: 100%;
    background: #ececec;
    border-color: #ececec;
    display: block;
    border: none;
}



.gekai {
    height: .6rem;
}

.denglu_bu {
    width: 100%;

    color: #aaa;
    font-size: .14rem;
    text-align: center;
    height: .7rem;
    position: fixed;
    left: 0;
    bottom: 0;
 
}

.weidenglu{
    font-size: .14rem;
    color: #333;
    margin: 0 .28rem;
}
.weidenglu>a{
    color: #1991EB;
}
.denglu_bu>a {

    color: #1991EB;
    font-size: .14rem;
}



`
